import React from "react";
import Logo from "../Logo.png";
import SearchBar from "./SearchBar.jsx";
import "./Nav.css";

function Nav({ onSearch }) {
  return (
    <div >
      <img className="logo" src={Logo} alt="" />
      <SearchBar />
    </div>
  );
}

export default Nav;
